import axios from 'axios';
import './App.css';
import { useEffect } from 'react';

function App() {

  useEffect(()=> {
    getAllEpisode();
  }, [])

  function getAllEpisode(){
    axios.get("https://rickandmortyapi.com/api/episode").then(res=> {
      console.log(res);
    })
  }

  return (
    <h1>App Component</h1>
  );
}

export default App;
